import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <ul>
        <li className="boy">Name 1</li>
        <li className="girl">Name 2</li>
        <li className="boy">Name 1</li>
        <li className="girl">Name 2</li>
        <li className="boy">Name 1</li>
        <li className="girl">Name 2</li>
        <li className="boy">Name 1</li>
        <li className="girl">Name 2</li>
        <li className="boy">Name 1</li>
        <li className="girl">Name 2</li>
      </ul>
    );
  }
}

export default App;
